import { Fragment, useEffect, useMemo, useState } from "react";
import "./styles.css";

const phonePattern = /(\b\d{4})\s?(\d{4}\b)/g;

function MaskedPhone({ digits, formatted }) {
  const [revealed, setRevealed] = useState(false);
  const masked = `${digits.slice(0, 4)} XXXX`;

  return (
    <button
      type="button"
      className={`phoneLink${revealed ? " isRevealed" : ""}`}
      onClick={() => setRevealed(true)}
      aria-label={revealed ? `Phone number ${formatted}` : `Reveal phone number ${masked}`}
    >
      {revealed ? formatted : masked}
    </button>
  );
}

export default function ListingAd({ flag, arrow_left, arrow_right, price, icon, pic, title, address, description, availabilities_label, subprice_label, project_type, year, ownership_type }) {
  const [showDescription, setShowDescription] = useState(true);

  useEffect(() => {
    setShowDescription(false);
  }, []);

  const descriptionLines = useMemo(() => {
    if (!description) return [];
    return description.split(/\r?\n/).map((line, lineIndex) => {
      const parts = [];
      let lastIndex = 0;
      let match;
      phonePattern.lastIndex = 0;

      while ((match = phonePattern.exec(line)) !== null) {
        if (match.index > lastIndex) {
          parts.push(line.slice(lastIndex, match.index));
        }

        const digits = `${match[1]}${match[2]}`;
        const formatted = `${match[1]} ${match[2]}`;

        parts.push(
          <MaskedPhone key={`${lineIndex}-${match.index}`} digits={digits} formatted={formatted} />
        );

        lastIndex = match.index + match[0].length;
      }

      if (lastIndex < line.length) {
        parts.push(line.slice(lastIndex));
      }

      return parts.length ? parts : ["\u00A0"];
    });
  }, [description]);

  const toggleDescription = () => setShowDescription((prev) => !prev);

  return (
    <div className="App">
      <div className="imageContainer">
        {flag && <img className="flag" src={flag} alt="Flag" />}
        <img className="mainPic" src={pic} alt={title} />
        
        <button className="arrowBtn arrowLeft">
          <img src={arrow_left} alt="Previous" />
        </button>
        <button className="arrowBtn arrowRight">
          <img src={arrow_right} alt="Next" />
        </button>
      </div>
      <div className="mainContent">
        <div className="topContent">
            <div className="leftContent">
              <div className="leftTopContent">
                <img className="icon" width="40" height="40" src={icon}/>
                  <div className="textLeftTopContent">
                    <h1 className="title">{title}</h1>
                    <p className="address">{address}</p>
                  </div>
              </div>
              <div className="leftBotContent">
                <p className="labelTop">{project_type} · {year} · {ownership_type}</p>
                <p className="labelBot">{availabilities_label}</p>
              </div>
            </div>

            <div className="rightContent">
              <div className="price">
                <h1>{price}</h1>
              </div>
              <p className="priceFrom">{subprice_label}</p>
            </div>
        </div>

        <div className="bottomSection">
          <div className="bottomContent">
            <button type="button" onClick={toggleDescription} aria-expanded={showDescription}>
              {showDescription ? "Hide description" : "See description"}
            </button>
          </div>
          {description && (
            <div className={`descriptionWrapper ${showDescription ? "isExpanded" : ""}`}>
              {descriptionLines.map((lineParts, lineIndex) => (
                <p className="descriptionLine" key={lineIndex}>
                  {lineParts.map((part, partIndex) => (
                    <Fragment key={`${lineIndex}-${partIndex}`}>{part}</Fragment>
                  ))}
                </p>
              ))}
            </div>
          )}
        </div>

      </div>
    </div>
  );
}
